import React from "react"
import { SwiperSlide } from "swiper/react";
import { Image } from "react-bootstrap"

const PickCarouselItem = ({ image }) => {
  return (
    <SwiperSlide>
      <Image src={`/image/Product/${image}`} alt={image} fluid />
    </SwiperSlide>
  )
}

export default PickCarouselItem
